config = configparser.ConfigParser()
config.read(r"C:\Users\Arunachalam\PycharmProjects\Pytest\.venv\config.ini")
url = config['config']['api_endpoint']


def test_png_encode_img():
    # url = self.url
    payload = json.dumps({
        "clientRefId": "test_png",
        "inputImage": ""
    })

    response_json = requests.request(
        "POST",
        url,
        data=payload,
        headers={'accept': 'application/json',
                 'Content-Type': 'application/json',
                 'Authorization': 'Basic NzQwNTEzNjI1NjI1OjlDMG5VWDNoTlQwRDBKSEhPV0dtdU54aWhrSVJDR3lH'
                 })
    png_encoded_api_response = response_json.json()
    req_id = png_encoded_api_response['ocrReqId']
    print("Test case: png file base64 encoded img url")
    print("Input request payload: ", payload)
    print("Client req id:", png_encoded_api_response['ocrReqId'])
    print("Base64 value output for png file:", png_encoded_api_response)
    conn = connection_to_sql()
    cursor = conn.cursor()
    query = "SELECT * FROM ocr.ocr_remittance where ocr_id=%s order by id desc"
    cursor.execute(query, (req_id,))
    result = cursor.fetchall()
    print("DB output:", result)
    cursor.close()
    assert png_encoded_api_response['statusCode'] == 200
    assert png_encoded_api_response['status'] == 'success'
    assert png_encoded_api_response['clientRefId'] == 'test_png'
    assert png_encoded_api_response['ocrReqId'] == req_id
    assert png_encoded_api_response['result'][0]['payment_reference'] == '1868378'
    assert png_encoded_api_response['result'][0]['amount'] == '6,684.00'
    assert png_encoded_api_response['result'][0]['transfer_date'] == '06/02/2024'
    assert png_encoded_api_response['result'][0]['transfer_bank_name'] == 'kinabank'
    assert png_encoded_api_response['result'][0]['additional_reference'].replace("'",
                                                                                 " ") == 'AFP -NCSL -Jan 24 -Employer No:018941'
    assert png_encoded_api_response['result'][0]['to_account'] == '20882217'
    assert png_encoded_api_response['result'][0]['recipient_name'] == 'NASFUND CONTRIBUTORS SAVINGS &'
    return
